#!/usr/bin/env python3

dna = ''

dna = dna.upper()

#subsetting the DNA sequence into nucleotide number 100 and 200
dna_subset = dna[99:200]
#counting the number of Gs
Gs = dna_subset.count('G')

string = "There are {} Gs, in the subsetted sequence: {}"
final_string = string.format(Gs,dna_subset)

print(final_string)


